import {makeStyles} from '@material-ui/core/styles'
import {flexbox} from '@material-ui/system'

const styles = makeStyles((theme) =>({
    navBar:{
        backgroundColor:'#21253c',
    },
    navBarBtn:{
        fontSize:17,
        color: '#fe4661',
    },
    box:{
        flexbox

    },
}))

export default styles;
